import { useState, useEffect, use } from 'react';

function ShowImages() {
  const [imgs, setImgs] = useState([])
  const [text, setText] = useState([])

  useEffect(() => {
    const getData = async () => {
      const response = await fetch("http://localhost:3000/data-scrapper")
      const output = await response.json()

      setImgs(output.imgs)
      setText(output.text)
  
      console.log(output)
    }
    getData()
  }, [])

  return (
    <div>
      {imgs.map((img, index) => {
          return(
            <div key={index}>
              <img src={img} alt=''></img>

              
                      <p>P/L {text.pl}</p>
                      <p>P/VP {text.pvp}</p>
                      <p>DY {text.dy}</p>
                      <p>ROE {text.roe}</p>
                   
                
              
            </div>
          ) 
        })
      }
    </div>
  );
}

export default ShowImages
